import React, { useEffect, useState } from "react";
import { getProvider, getMyNFTs, getEthBalance } from "../contractUtils";
import { useNavigate, useLocation } from "react-router-dom";

export default function Inventory({ setWalletAddress }) {
  const [address, setAddress] = useState(null);
  const [cars, setCars] = useState([]);
  const [houses, setHouses] = useState([]);
  const [balance, setBalance] = useState("0");
  const navigate = useNavigate();
  const location = useLocation();

  // Handle search filter from navbar
  const params = new URLSearchParams(location.search);
  const searchQuery = params.get("search")?.toLowerCase() || "";

  useEffect(() => {
    async function fetchData() {
      const provider = await getProvider();
      const signer = provider.getSigner();
      const userAddress = await signer.getAddress();
      setAddress(userAddress);
      setWalletAddress(userAddress);
      const nfts = await getMyNFTs(userAddress);
      setCars(
        nfts.filter(
          (nft) =>
            nft.itemType === "car" &&
            nft.name.toLowerCase().includes(searchQuery)
        )
      );
      setHouses(
        nfts.filter(
          (nft) =>
            nft.itemType === "house" &&
            nft.name.toLowerCase().includes(searchQuery)
        )
      );
      if (
        userAddress &&
        typeof userAddress === "string" &&
        userAddress.startsWith("0x") &&
        userAddress.length === 42
      ) {
        setBalance(await getEthBalance(userAddress));
      }
    }
    fetchData();

    const interval = setInterval(async () => {
      if (
        address &&
        typeof address === "string" &&
        address.startsWith("0x") &&
        address.length === 42
      ) {
        setBalance(await getEthBalance(address));
      }
    }, 10000);
    return () => clearInterval(interval);
    // eslint-disable-next-line
  }, [address, searchQuery]);

  return (
    <div className="main-content" style={{ paddingTop: 10 }}>
      <h1 style={{ marginTop: 0, marginBottom: 28 }}>Your Properties</h1>
      <div style={{ marginBottom: 34, fontSize: 15, color: "#666" }}>
        View your owned houses and cars below. Use the Transfer tab to send an item.
      </div>
      <div>
        <div style={{ fontWeight: "bold", fontSize: 18, marginBottom: 10 }}>
          Houses
        </div>
        <div style={{ display: "flex", gap: 32, flexWrap: "wrap" }}>
          {houses.length === 0 && <span>No houses owned.</span>}
          {houses.map((nft) => (
            <div key={nft.tokenId} className="asset-card">
              <div className="asset-type">🏠</div>
              <div className="asset-title">{nft.name}</div>
              <div className="asset-detail">Worth: ${nft.value}</div>
              <div className="asset-detail">Purchased: {nft.purchaseDate}</div>
              <div className="asset-detail">Address: {nft.addr}</div>
              <div style={{ fontSize: 12, color: "#888" }}>
                NFT ID: {nft.tokenId}
              </div>
            </div>
          ))}
        </div>
      </div>
      <div
        style={{ fontWeight: "bold", fontSize: 18, margin: "30px 0 10px 0" }}
      >
        Cars
      </div>
      <div style={{ display: "flex", gap: 32, flexWrap: "wrap" }}>
        {cars.length === 0 && <span>No cars owned.</span>}
        {cars.map((nft) => (
          <div key={nft.tokenId} className="asset-card">
            <div className="asset-type">🚗</div>
            <div className="asset-title">{nft.name}</div>
            <div className="asset-detail">Worth: ${nft.value}</div>
            <div className="asset-detail">Purchased: {nft.purchaseDate}</div>
            <div className="asset-detail">VIN: {nft.vin}</div>
            <div style={{ fontSize: 12, color: "#888" }}>
              NFT ID: {nft.tokenId}
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
